import "./AddItems.css";
class AddItems extends Component {
  state={
      name:"",
      age
  }
    render() {
    return (
      <div>
        <form>
          <input
            type="text"
            placeholder="Enter Name..."
            id="name"
            onClick={this.handleChange}
          />
          <input
            type="text"
            placeholder="Enter Age..."
            id="age"
            onClick={this.handleChange}
          />
          <input type="submit" value="Add"/>
        </form>
      </div>
    );
  }
}
export default AddItems;
